import React, { useState } from 'react';
import { useAntdColumnResize } from 'react-antd-column-resize';

const App = () => {
  const [columns, setColumns] = useState<any[]>([
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
      width: 200,
      align: 'center',
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
      width: 100,
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
      width: 300,
    },
    {
      title: 'phone',
      dataIndex: 'phone',
      key: 'phone',
      //fixed: 'right',
    },
  ]);

  const data = [
    {
      key: '1',
      name: 'John Doe',
      age: 32,
      address: '123 Street, City',
      phone: '1588553336',
    },
    {
      key: '2',
      name: 'Jane Smith',
      age: 28,
      address: '456 Road, Town',
      phone: '1588553336',
    },
  ];
  const addColumns = () => {
    const time = String(new Date().getTime());
    columns.push({
      title: time,
      dataIndex: time,
      key: time,
    });
    setColumns([...columns]);
  };

  const { resizableColumns, components, tableWidth, resetColumns } =
    useAntdColumnResize(() => {
      return { columns };
    }, [columns]);

  return (
    <div className="app">
      <Space size={20}>
        <Button onClick={addColumns}>\u6DFB\u52A0Columns</Button>
        <Button onClick={resetColumns}>\u91CD\u7F6EColumns</Button>
      </Space>
      <Divider />
      <Table
        columns={resizableColumns}
        dataSource={data}
        components={components}
        bordered
        //@ts-ignore
        scroll={{ x: tableWidth || false }}
      />
    </div>
  );
};

export default App;
